 ('artcl_1','CAT_ARTICLE','ashutosh049','ACTIVE','Accessing Facebook Data','Before you can fetch a user?s data from Facebook, you must specify your application?s ID and secret by setting the spring.social.facebook.appId and spring.social.facebook.appSecret properties. You can set these via any means supported by Spring Boot, including setting them in an application.properties file.1','2016-06-22 07:06:08','2016-06-22 07:06:20','1,2,3',NULL,'C:/THRASHREPO/articles/artcl_1//artcl_1.txt','article',42,13,3),
 ('artcl_2','CAT_TIPS_TRICKS','jagdeep.dhanoa','INACTIVE','Create intermediate folders if one doesn\'t exist','I am trying to create a folder for each username a user logs in as. Currently I have.\r\nbut the File theFile bit does not create a new folder for the username. How would I do this ?','2016-06-22 07:18:21','2016-06-22 07:18:27','Java,File',NULL,'C:/THRASHREPO/articles/artcl_2//artcl_2.txt','tips_tricks',55,60,4),
 ('artcl_3','CAT_CODE_PICKS','ashutosh049','PENDING','File Class (java.io.File)','A file system may implement restrictions to certain operations on the actual file-system object, such as reading, writing, and executing. These restrictions are collectively known as access permissions. The file system may have multiple sets of access permissions on a single object. For example, one set may apply to the object\'s owner, and another may apply to all other users. The access permissions on an object may cause some methods in this class to fail.','2016-06-22 07:33:15','2016-06-22 07:33:15','Java,IO Package,File',NULL,'C:/THRASHREPO/articles/artcl_3//artcl_3.txt','article',66,50,9),
 ('artcl_4','CAT_TIPS_TRICKS','ashutosh049','ACTIVE','Overriding vs. Overloading in Java','Overriding and Overloading are two very important concepts in Java. They are confusing for Java novice programmers. This post illustrates their differences by using two simple examples.','2016-06-23 07:42:11','2016-06-23 07:42:11','java,overloading,overiding',NULL,'C:/THRASHREPO/articles/artcl_4//artcl_4.txt','article',54,7,3),
