 ('artcl_7','CAT_CODE_PICKS','vaibhav.jain','ACTIVE','Implement a Stack Using an Array in Java','This post shows how to implement a stack by using an array.\r\n\r\nThe requirements of the stack are: 1) the stack has a constructor which accept a number to initialize its size, 2) the stack can hold any type of elements, 3) the stack has a push() and a pop() method.\r\n\r\n\r\nI remember there is a similar example in the \"Effective Java\" book written by Joshua Bloch, but not sure how the example is used. So I just write one and then read the book, and see if I miss anything.','2016-06-23 16:40:15','2016-06-23 16:40:15','Java,Array,Stack,LinkedList',NULL,'C:/THRASHREPO/articles/artcl_7//artcl_7.txt','article',116,68,1),
